/**
 * @param {number[]} nums
 * @return {boolean}
 */
var canTraverseAllPairs = function(nums) {
    const find = (x) => {
        if (parent[x] !== x) parent[x] = find(parent[x]);
        return parent[x];
    };

    const union = (x, y) => {
        const rootX = find(x);
        const rootY = find(y);
        if (rootX !== rootY) parent[rootX] = rootY;
    };

    const gcd = (a, b) => {
        if (b === 0) return a;
        return gcd(b, a % b);
    };

    const n = nums.length;
    const parent = Array.from({length: n}, (_, i) => i);

    for (let i = 0; i < n; i++) {
        for (let j = i + 1; j < n; j++) {
            if (gcd(nums[i], nums[j]) > 1) {
                union(i, j);
            }
        }
    }

    const root = find(0);
    for (let i = 1; i < n; i++) {
        if (find(i) !== root) return false;
    }

    return true;
};
